import React from 'react'
import{SidebarContainer,Icon,CloseIcon}from './side'
import {links} from '../../data/data'
function Sidebar() {
    return (
       <>
       <SidebarContainer>
           <Icon>
               <CloseIcon/>
           </Icon>
           <SidebarWrapper>
               <SidebarMenu>
                 {links.map((item)=>{
                     const{url,text,id}=item;
                     return <SidebarLink to={url} key={id}>
                             {text}
                     </SidebarLink>
                 })}
               </SidebarMenu>
               <SideBtnWrap>
                   <SidebarRoute to='/signin'>
                       Sign-In
                   </SidebarRoute>
               </SideBtnWrap>
           </SidebarWrapper>
       </SidebarContainer>
       </>
    )
}

export default Sidebar
